import React from 'react'

interface HeadingProps {
  name: string;
  description: string;
}

export const Heading: React.FC<HeadingProps> = ({ name, description }) => {
  return (
    <div>
      <h1 className="mb-4 text-3xl font-extrabold text-gray-900 dark:text-white md:text-5xl lg:text-6xl">
        <span className="text-transparent bg-clip-text bg-gradient-to-r to-emerald-600 from-sky-400">{name}</span>
      </h1>
      <p className="text-lg font-normal text-gray-500 lg:text-xl dark:text-gray-400">{description}</p>
    </div>
  )
}
